        <div class="d-flex flex-wrap align-items-center justify-content-center justify-content-lg-start border-bottom">
            <h1 class="mx-5">Интернет банк</h1>
            <ul class="nav col-12 col-lg-auto me-lg-auto justify-content-center mb-md-0">
                <li><label class="nav-link px-2 link-secondary"><NavLink to="" style={{textDecoration: "none"}}>ГЛАВНАЯ</NavLink></label></li>
                <li><label class="nav-link px-2 link-secondary"><NavLink to="" style={{textDecoration: "none"}}>ПЛАТЕЖИ</NavLink></label></li>
                <li><label class="nav-link px-2 link-secondary"><NavLink to="" style={{textDecoration: "none"}}>ИСТОРИЯ ОПЕРАЦИЙ</NavLink></label></li>
            </ul>
      </div>
    )
}
